class Solution:
    def majorityElement(self, nums) -> int:
        result=None
        count=0
        nums2=nums
       
        i=0
        while i<len(nums2):
            res=0
            arr=[]
            for j in range(len(nums2)):
                if nums2[i]==nums2[j]:
                    res+=1
                else:
                    arr.append(nums2[j])   
            if res>count:
                result=nums2[i]
                count=res
            i+=1
            res=0
            nums2=arr

        print(result)
        pass


